import React from 'react';
import './App.css';
const Header = React.lazy(() => import('./Header'));
const Banner = React.lazy(() => import('./Banner'));
const MenuName = React.lazy(() => import('./MenuName'));
const MenuImgs = React.lazy(() => import('./MenuImgs'));

function App() {
  return (
    <div className="App">
      <section>
        <Header/>
      </section>
      <section>
        <Banner/>
      </section>
      <section>
        <MenuName/>
      </section>
      <section>
        <MenuImgs/>
      </section>

      <div className="zakazDiv">
        <div className="summa">
          <p className="summaP">Общая сумма</p>
          <p className="summaUzs">UZS 120 800</p>
        </div>
        <div className="zakazButton">
          ЗАКАЗАТЬ
        </div>
      </div>
    </div>
  );
}

export default App;
